import "../stylesheets/Card.scss";

const Card = (props) => {
  return (
    <>
      <img
        className="item__img"
        src={props.src}
        alt={props.alt}
        title={props.name}
      />
      <h2 className="item__name">{props.name}</h2>
      <p className="item__description">{props.description}</p>
    </>
  );
};

Card.defaultProps = {
  src: "https://www.google.com/url?sa=i&url=http%3A%2F%2Fnaipcollectionutrera.blogspot.com%2F2016%2F11%2Fbaraja-de-cartas-naipes-comas-n-7.html&psig=AOvVaw2SuzgjAKasbNkwqNQC4WEt&ust=1623269986083000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCMiRnIruiPECFQAAAAAdAAAAABAD",
};
export default Card;
